    false,nt"url": null,nt"notes": "tnCowcod are the primary species that have
    influenced groundfish regulations since 2001 in California waters. More progressive
    management approaches have been adopted during this time, and many rockfish species,
    including cowcod, now appear to be rebuilding. This rebuilding has recently translated
    into increased cowcod catches by both recreational and commercial fishers, and the
    use of descending devices has become a popular method for releasing these fish with
    as little harm as possible. However, post-release mortality of cowcod associated
    with the use of these descending devices is still unclear. We have tagged __ adult
    individuals using acoustic telemetry methods, and analyses of these movement data
    are currently underway. We will also tag juvenile and sub-adult cowcod in an effort
    to estimate size-dependent post-release mortality and movement patterns. This will
    give us a better understanding of the rebuilding status of the species, and how
    changes in fishing regulations might affect this rebuilding.",nt"license_title":
